import React from "react";
import ReactDOM from 'react-dom';
import Modal from 'react-modal';

const customStyles = {
  content : {
    top                   : '50%',
    left                  : '50%',
    right                 : 'auto',
    bottom                : 'auto',
    marginRight           : '-50%',
    transform             : 'translate(-50%, -50%)'
  }
};

export default function Task()
{
    return <div class="container-fluid">
        <div class="row col-12 taskheader">
           <span>To do list - date</span>
        </div>
        <button class="addbutton"><i class="fas fa-plus-circle fa-2x"></i></button>
    </div>

}
